pragma solidity ^0.4.0;

contract Bidder {

    /* Fields */
    string public name;
    uint public bidAmount = 2000;
    bool public eligible;
    uint constant minBid = 1000;

    function setName(string nm) public {
        name = nm;
    }

    function setBidAmount(uint x) public {
        bidAmount = x;
    }

    function determinaEligibility() public {}
}

